script: |
  super -f text -I q11030.spq | sort > q11030.out

inputs:
  - name: q11030.spq
    data: |
      SELECT DISTINCT col1 + col2 AS col0 FROM tab1 (FORMAT parquet) WHERE NOT + col2 IN ( + col1 * col2 * col2 - + col0 + CAST ( NULL AS INTEGER ) );
  - name: tab1

outputs:
  - name: q11030.out
    data: |
